import React from 'react';
import Post from './Post';

class PostList extends React.Component{

  constructor(props){
    super(props);
  }

  render(){
    return(
      <div>
        <Post date={"June 1st"} title={"First Post"} />
      </div>
    )
  }
}

export default PostList
